L’Association des nations de l'Asie du Sud-Est (ASEAN ou ANASE) est une organisation politique, économique et culturelle regroupant dix pays d'Asie du Sud-Est. Elle a été fondée en 1967 à Bangkok (Thaïlande) par cinq pays dans le contexte de la guerre froide pour faire barrage aux mouvements communistes, développer la croissance et le développement et assurer la stabilité dans la région. Aujourd'hui, l'association a pour but de renforcer la coopération et l'assistance mutuelle entre ses membres, d'offrir un espace pour régler les problèmes régionaux et peser en commun dans les négociations internationales. Un sommet est organisé chaque année au mois de novembre. Son secrétariat général est installé à Jakarta (Indonésie). En 2013, les pays de cette organisation représentaient : 
* 620 millions d'habitants (environ 8,8 % de la population mondiale) ; 
* 2 400 milliards US$ de PIB ; 
* 76 milliards US$ d'investissements étrangers (2010).
